import React, { Component } from 'react';
import { Route, BrowserRouter } from 'react-router-dom'
class AppRoutes extends Component {
  render() {
    return (
      <BrowserRouter>
        <Route location={'/'} component={null}/>
      </BrowserRouter>  
    );
  }
}

export default AppRoutes;
